import React from "react";
import "./App.css";

class Atom extends React.Component {
    render() {
        return (
            <div id="atomBg"></div>
        )
    }
}

class Blob extends React.Component {
    render() {
        return (
            <div id="blob"></div>
        )
    }
}

class Intro extends React.Component {
    render() {
        return (
            <div id="intro"></div>
        )
    }
}

class Template extends React.Component {
    render() {
        return (
            <div id="container">
                < Atom />
                < Blob />
            </div>
        )
    }
}

export default Template;
